import { BEET_PACKAGE } from '../types';
/**
 * De/Serializer for non-values, i.e. `void`, `()`, `undefined` aka the _unit_ type .
 *
 * @category beet/primitive
 */
export const unit = {
    write: function (_buf, _offset, _value) { },
    read: function (_buf, _offset) {
        return undefined;
    },
    byteSize: 0,
    description: 'unit',
};
/**
 * Maps unit beet exports to metadata which describes in which package it
 * is defined as well as which TypeScript type is used to represent the
 * deserialized value in JavaScript.
 *
 * @category TypeDefinition
 */
export const unitTypeMap = {
    unit: {
        beet: 'unit',
        isFixable: false,
        sourcePack: BEET_PACKAGE,
        ts: 'void',
    },
};
